    constructor(props){
        super(props);

        this.state = {
            companyId: this.props.companyId,
        };
    }

    componentDidMount() {
        this.getItems();
    }

    getItems() {
        ItemService.getItemDetail('0f95b4d63b1afa75c3a9e2b3fae27cdf')
            .then((response) => response.json())
            .then((responseJson) => {
                this.setState({
                    itemList: responseJson.children
                });
            })
            .catch((error) => {
                console.error(error);
            });
    }

